import React from "react";
import "./App.css";
import { Route, Router, Switch, Link, NavLink } from "react-router-dom";
import { History } from "history";
import { Add, TodoList } from "./pages";
export interface IAppProps {
  history: History;
}
const App: React.SFC<IAppProps> = ({ history }) => (
  <Router history={history}>
    <div>
      <NavLink to={"/"} exact={true}>
        <i className="iconfont icon-zhuye"></i>
        <span>首页</span>
      </NavLink>
      <NavLink to={"/Goods"}>
        <i className="iconfont icon-hezi"></i>
        <span>出行服务</span>
      </NavLink>
      <NavLink to={"/order"}>
        <i className="iconfont icon-guizi"></i>
        <span>订单</span>
      </NavLink>
      <NavLink to={"/cart"}>
        <i className="iconfont icon-icon--"></i>
        <span>铁路会员</span>
      </NavLink>
      <NavLink to={"/personal"}>
        <i className="iconfont icon-geren10"></i>
        <span>我的</span>
      </NavLink>
    </div>
    <Switch>
      <Route path="/todolist" component={TodoList} />
      <Route path="/add" component={Add} />
    </Switch>
  </Router>
);

export default App;
